import React from "react";

const harrypotter = () => {
  return (
    <div>
      <img
        src="./harrypotter.jpg"
        alt="harrypotter"
        style={{ width: "20%", borderRadius: "5%" }}
      ></img>
    </div>
  );
};

export default harrypotter;
